import axios from 'axios';
import config from './static/config';

// const baseUrl = 'http://localhost:3000'

function setAuthToken(token) {
    localStorage.authToken = token;
}

export async function register(email, password, first_name, last_name, isVendor) {
    await axios({
        method: 'post',
        url: 'http://localhost:8000/user/register',
        data: {
            email: email,
            password: password,
            first_name: first_name,
            last_name: last_name,
            isVendor: isVendor,
        },
    }).then((response) => {
        setAuthToken(response.data.token);
    });
}

// prettier-ignore
export async function registerPrinter(make, model, filaments, 
    printDimensionX, printDimensionY, printDimensionZ, dimensionUnit) {
    let response = await axios({
        method: 'post',
        url: 'http://localhost:8000/user/verify',
        data: {
            token: localStorage.authToken
        },
    });
    await axios({
        method: 'post',
        url: 'http://localhost:8000/user/printer/register',
        headers: {
             Authorization: `Bearer ${localStorage.authToken}`
          },
        data: {
            make: make,
            model: model,
            filaments: filaments,
            max_print_dimension_x: printDimensionX,
            max_print_dimension_y: printDimensionY,
            max_print_dimension_z: printDimensionZ,
            dimension_unit: dimensionUnit,
        },
    });
    return response.data.user;
}

export async function signIn(email, password) {
    await axios({
        method: 'post',
        url: 'http://localhost:8000/user/login',
        data: {
            email: email,
            password: password,
        },
    }).then((response) => {
        setAuthToken(response.data.token);
    });
}

/* MODELER API */
export function getMyModels() {
    return config.models;
}

export function getMyOffers() {
    return config.myOffers;
}

export function getMyJobsInProgress() {
    return config.models;
}

export function getMyCompletedPrints() {
    return config.models;
}

/* VENDOR API */
export function getNewJobs() {
    return config.models;
}

export function getMyBids() {
    return config.models;
}

export function getCurrentJobs() {
    return config.models;
}

export function getPastJobs() {
    return config.models;
}
